class Solution {
  int countPairs(List<List<int>> coordinates, int k) {
    final Map<int, List<int>> xMap = {};
    final Map<int, List<int>> yMap = {};
    int count = 0;

    // Group coordinates by their x and y values
    for (var coordinate in coordinates) {
      int x = coordinate[0], y = coordinate[1];
      xMap.putIfAbsent(x, () => []).add(y);
      yMap.putIfAbsent(y, () => []).add(x);
    }

    // Count pairs with XOR distance equal to k by checking possible x or y matches
    for (var coordinate in coordinates) {
      int x = coordinate[0], y = coordinate[1];
      int targetX = x ^ k, targetY = y ^ k;

      // Count matches in xMap if y is the same
      if (xMap.containsKey(targetX)) {
        count += xMap[targetX]!.where((int val) => (val ^ y) == k).length;
      }

      // Count matches in yMap if x is the same, avoiding double counting
      if (yMap.containsKey(targetY) && k != 0) { // Avoid double counting when k == 0
        count += yMap[targetY]!.where((int val) => (val ^ x) == k).length;
      }
    }

    // Adjust for over-counting since each pair is counted twice
    return count ~/ 2;
  }
}
